import{_ as t,o as a,c as e,e as d}from"./app-5de3c553.js";const r={},i=d('<h2 id="记录一次安卓反编译过程" tabindex="-1"><a class="header-anchor" href="#记录一次安卓反编译过程" aria-hidden="true">#</a> 记录一次安卓反编译过程</h2><p>下周就要安卓课设，而我的课设作业是开发一个记事本，我发现我小米手机上的便签挺好的，于是想参考一下布局以及实现。</p><table><thead><tr><th>软件</th><th>apktool</th><th>dex2jar</th><th>jd-jui</th></tr></thead><tbody><tr><td>版本</td><td>2.4.1</td><td>2.1</td><td>0.3.5</td></tr></tbody></table><h3 id="准备工作" tabindex="-1"><a class="header-anchor" href="#准备工作" aria-hidden="true">#</a> 准备工作</h3><ol><li><p>获取小米便签<br> 网上没有最新版下载，通过Es文件浏览器导出apk。<br> 也可以通过mt浏览器，因为后面需要三个framework文件，Es浏览器和Re浏览器好像屏蔽了根目录，不能访问了。</p></li><li><p>下载反编译相关工具<br><a href="https://www.runoob.com/w3cnote/android-tutorial-decompile-apk-get-code-resources.html" target="_blank" rel="noopener noreferrer">菜鸟教程</a><s>的<a href="http://static.runoob.com/download/%E5%8F%8D%E7%BC%96%E8%AF%91%E7%9B%B8%E5%85%B3%E7%9A%84%E4%B8%89%E4%B8%AA%E5%B7%A5%E5%85%B7.zip" target="_blank" rel="noopener noreferrer">三个工具</a></s>,版本低,</p></li><li><p>我使用的<a href="https://pan.baidu.com/s/1Lox7zYgUyfeB5H0i3aFxZw" target="_blank" rel="noopener noreferrer">三个工具</a> 密码：7uyi</p></li></ol><h3 id="开始反编译" tabindex="-1"><a class="header-anchor" href="#开始反编译" aria-hidden="true">#</a> 开始反编译</h3><figure class="highlight bash"><figcaption data-lang="bash"></figcaption><div class="code-container"><table><tr><td data-num="1"></td><td><pre>apktool.bat d base.apk</pre></td></tr></table><div class="operation"><span class="breakline-btn"><i class="ic i-align-left"></i></span><span class="copy-btn"><i class="ic i-clipboard"></i></span><span class="fullscreen-btn"><i class="ic i-expand"></i></span></div></div></figure><p><img src="https://i.loli.net/2020/06/04/ZXokSryDnmITE6L.png" alt="Could not decode arsc file"></p><p>这个是由于apktool版本低导致的，下载<a href="https://bitbucket.org/iBotPeaches/apktool/downloads/" target="_blank" rel="noopener noreferrer">最新的</a>重命名为apktool.jar替换即可<br> 更新最新apktool后再次执行命令，还是失败，错误信息如下：</p><figure class="highlight bash"><figcaption data-lang="bash"></figcaption><div class="code-container"><table><tr><td data-num="1"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=miui, name=fabColor, value=0x7f06002e</pre></td></tr><tr><td data-num="2"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=miui, name=fabColor, value=0x7f06002e</pre></td></tr><tr><td data-num="3"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=android, name=id, value=0x100b0001</pre></td></tr><tr><td data-num="4"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=miui, name=fabColor, value=0x7f06002e</pre></td></tr><tr><td data-num="5"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=, name=layout, value=0x10030009</pre></td></tr><tr><td data-num="6"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=, name=style, value=0x100d008f</pre></td></tr><tr><td data-num="7"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=android, name=textAppearance, value=0x100d0058</pre></td></tr><tr><td data-num="8"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=, name=style, value=0x100d008f</pre></td></tr><tr><td data-num="9"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=android, name=textAppearance, value=0x100d008f</pre></td></tr><tr><td data-num="10"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=miui, name=fabColor, value=0x7f06002e</pre></td></tr><tr><td data-num="11"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=android, name=height, value=0x100a0003</pre></td></tr><tr><td data-num="12"></td><td><pre>W: Could not decode attr value, using undecoded value instead: ns=android, name=width, value=0x100a0003</pre></td></tr><tr><td data-num="13"></td><td><pre>I: Decoding values */* XMLs...</pre></td></tr><tr><td data-num="14"></td><td><pre>Can&#39;t find framework resources for package of id: 16. You must install proper framework files, see project website for more info.</pre></td></tr></table><div class="operation"><span class="breakline-btn"><i class="ic i-align-left"></i></span><span class="copy-btn"><i class="ic i-clipboard"></i></span><span class="fullscreen-btn"><i class="ic i-expand"></i></span></div></div></figure><p>查看一下反编译结果，发现资源以及提取出来，但是没有任何代码。<br> 百度了最后一句话发现，有些应用需要提供额外框架，具体信息可以查看一下博文<a href="https://blog.csdn.net/qq_34149335/article/details/85317554" target="_blank" rel="noopener noreferrer">Android逆向工程：解决针对小米系统应用，使用Apktool反编译失败问题！</a></p><p>根据博文我提取了文章中提到的framework-res.apk，framework-ext-res.apk，miui.apk。<br><img src="https://i.loli.net/2020/06/04/9Qt8rOxRElfmUTM.png" alt="文件列表"></p><p>执行一下命令安装：</p><figure class="highlight bash"><figcaption data-lang="bash"></figcaption><div class="code-container"><table><tr><td data-num="1"></td><td><pre>apktool if framework-res.apk</pre></td></tr><tr><td data-num="2"></td><td><pre>apktool if framework-ext-res.apk</pre></td></tr><tr><td data-num="3"></td><td><pre>apktool if miui.apk</pre></td></tr></table><div class="operation"><span class="breakline-btn"><i class="ic i-align-left"></i></span><span class="copy-btn"><i class="ic i-clipboard"></i></span><span class="fullscreen-btn"><i class="ic i-expand"></i></span></div></div></figure><p>安装完成后发现缺少的16号对应framework-ext-res.apk</p><p><img src="https://i.loli.net/2020/06/04/MKstzCTDjSVB6c3.png" alt="缺少的16号"></p><p>再次执行 apktool.bat d base.apk 后发现还有问题，提示缺少了id为18的框架文件</p><p><img src="https://i.loli.net/2020/06/04/fpaNmjZBkUAHzbs.png" alt="缺少了id为18的框架文件"></p><p>我有点头疼，我怎么知道18号是什么文件，于是尝试导入其他文件，搜索framework，找到了一个名为XiaomiServiceFramework.apk的文件，并进行安装；</p><p><img src="https://i.loli.net/2020/06/04/aCuLyGkgOSX3zT4.png" alt="apktool if XiaomiServiceFramework.apk"></p><p>根据上图，我发现这个文件不是我们需要的，但它提供了一个信息：<br> ++I: Decoding Shared Library (miui.system), pkgId: 18++<br> 于是我去搜索system，经过筛选找到miuisystem.apk，进行安装，发现他就是我们需要的18号：</p><p><img src="https://i.loli.net/2020/06/04/2KEGIgHxmPlTDpM.png" alt="apktool if miuisystem.apk"><br> 再次反编译没有报错，查看文件发现Smali代码成功获取：</p><p><img src="https://i.loli.net/2020/06/04/fvRbyGZUATC5u2S.png" alt="成功截图"></p><p>反编译到此结束，会smali语法的大佬已经可以阅读代码了，不会的可以使用<a href="https://pan.baidu.com/s/1Cr1E4Cw7d_djRkU92R12kQ" target="_blank" rel="noopener noreferrer">工具</a>转java再阅读</p><h3 id="使用dex2jar将dex转成jar" tabindex="-1"><a class="header-anchor" href="#使用dex2jar将dex转成jar" aria-hidden="true">#</a> 使用dex2jar将dex转成jar</h3><ol><li>将base.apk当成压缩包打开</li><li>提取 classes.dex，classes2.dex<br> 执行命令：</li></ol><figure class="highlight bash"><figcaption data-lang="bash"></figcaption><div class="code-container"><table><tr><td data-num="1"></td><td><pre>d2j-dex2jar.bat classes.dex</pre></td></tr><tr><td data-num="2"></td><td><pre>d2j-dex2jar.bat classes2.dex</pre></td></tr></table><div class="operation"><span class="breakline-btn"><i class="ic i-align-left"></i></span><span class="copy-btn"><i class="ic i-clipboard"></i></span><span class="fullscreen-btn"><i class="ic i-expand"></i></span></div></div></figure><p><img src="https://i.loli.net/2020/06/04/CdtOHRTqI81vZzk.png" alt="d2j-dex2jar.bat classes.dex"><br> 这个也是版本低导致的，下载<a href="https://github.com/pxb1988/dex2jar/releases" target="_blank" rel="noopener noreferrer">最新的</a>就可以了<br> 再次执行,出了新问题,我之前没遇到</p><figure class="highlight bash"><figcaption data-lang="bash"></figcaption><div class="code-container"><table><tr><td data-num="1"></td><td><pre>C:\\Users\\dyt\\Desktop\\dex-tools-2.1-SNAPSHOT&gt;d2j-dex2jar.bat classes.dex</pre></td></tr><tr><td data-num="2"></td><td><pre>dex2jar classes.dex -&gt; .\\classes-dex2jar.jar</pre></td></tr><tr><td data-num="3"></td><td><pre>Detail Error Information in File .\\classes-error.zip</pre></td></tr><tr><td data-num="4"></td><td><pre>Please report this file to one of following link if possible (any one).</pre></td></tr><tr><td data-num="5"></td><td><pre>    https://sourceforge.net/p/dex2jar/tickets/</pre></td></tr><tr><td data-num="6"></td><td><pre>    https://bitbucket.org/pxb1988/dex2jar/issues</pre></td></tr><tr><td data-num="7"></td><td><pre>    https://github.com/pxb1988/dex2jar/issues [no attachment support, not preferred]</pre></td></tr><tr><td data-num="8"></td><td><pre>    dex2jar@googlegroups.com</pre></td></tr></table><div class="operation"><span class="breakline-btn"><i class="ic i-align-left"></i></span><span class="copy-btn"><i class="ic i-clipboard"></i></span><span class="fullscreen-btn"><i class="ic i-expand"></i></span></div></div></figure><p>换了一个多了后缀的2.1版本，成功解决，但我不记得在哪下的了</p><p><img src="https://i.loli.net/2020/06/04/UGmDHJeog4KQwWX.png" alt="成功获取jar"></p><p><img src="https://i.loli.net/2020/06/04/HT1npCbsFUSjRqw.png" alt="获取的jar"></p><h3 id="使用jd-gui查看" tabindex="-1"><a class="header-anchor" href="#使用jd-gui查看" aria-hidden="true">#</a> 使用jd-gui查看</h3><p>这个就是软件使用了，跟一般软件没区别，将jar包拖到jd-gui.exe就行了，不多说，自己体会。</p><p><img src="https://i.loli.net/2020/06/04/DfpVFCQrwcY16Ey.png" alt="使用截图"></p>',35),s=[i];function n(l,p){return a(),e("div",null,s)}const c=t(r,[["render",n],["__file","aa3015f4.html.vue"]]);export{c as default};
